import logo from '../logo.svg';
import Navbar from './navbar';
import Home from './home';
import Foot from './foot';
import pic from '../img/bsea-logo.png';

function App() {
  return (
    <div className="App">
      <Navbar brandTitle="BSEA Cambodia" brandImg={pic}/>
      <Home />
      <Foot />
    </div>
  );
}

export default App;
